create database creditcard;
create table credit_card_transcations (
	transcation_id int auto_increment not null,
    city varchar(50) not null,
    transcation_date date not null,
    card_type varchar(50) not null,
    exp_type varchar(50) not null,
    gender varchar(10) not null,
    amount int not null,
    primary key (transcation_id) ) ;
    
drop table credit_card_transcations;
select * from credit_card_transcations;


